import React from 'react';
const City =(props)=>{
    return(
        <div className="city">
        <img src={props.img} alt="image"/>
          <h6>{props.visit}</h6>
            <br/>
            <h6> {props.follow}</h6>
            <br/>
            <h6>  {props.contact} </h6>
        
    </div>
    )
}

export default City;
